   /******************************************************************************/
   // Feature name: Bad Pixel Correction 2 (Defect Pixel Correction).
   // Applicable chipset(s): HW version 8996 or later.
   // Applicable operation mode: Preview, camcorder record and snapshot.
   //
   // Control Parameters
   //
   // Variable name: bpc2_hysteresis_trigger.
   // Hysteresis trigger to control BPC2 enable flag, when BPC2_en set to 1,
   //   if trigger is > trigger_end, then BPC2 will be enabled and if (trigger_start < trigger < trigger_end),
   //   enable flag decided based on trigger in upward direction (disabled) or in downward direction (enabled).
   //   Notes: Default setting to disable BPC2 for video recording, recommendation to set hysteresis trigger equal to 4th region
   //   wavelet trigger (~50lux). To completely disable BPC2, push the
   //   hysteresis trigger to larger values (100, 200, 1000, 2000) i.e. larger than max_gain and max_lux_idx.
   //   To enable BPC2 module always, program hysteresis trigger to (0.8, 0,9, 80,90) i.e. smaller than min_gain and min_lux_idx.
   //   For Snapshot , hysteresis depends on snapshot_hyst_en_flag. If flag is set to 0, hysteresis is disabled
   //   (i.e. BPC2 enabled).
   // Default value: For Video {4th_rgn_gain_start,4th_rgn_gain_end,4th_rgn_lux_start,4th_rgn_lux_end} (calculated),
   //                For snapshot {0.8,0.9,80,90}.
   //
   // Variable name: bpc2_snapshot_hyst_en_flag.
   // Flag to enable or disable BPC2 hysteresis for snapshot use cases.
   //   This flag will be ignored for video or streaming/continuous mode operation.
   //   Default setting of this flag to 0 i.e. disable hysteresis, hence BPC2 Enabled.
   //   If flag set to 1, hysteresis will be enabled, BPC2 enable flag will be decided based on trigger changes.
   // Default value: 0 (for snapshot, video live shot use cases),
   //                ignored for all other use cases.
   //
   // Reserve Parameters
   //
   // Variable name: hot_pixel_correction_disable.
   // Enables and disables Hot pixel Detection and Correction.
   // Default value: 0.
   // Data range: 0 to 1 (1u)
   // Constraints: None.
   // Effect: 0 disables the feature, 1 enables the feature.
   //
   // Variable name: cold_pixel_correction_disable.
   // Enables and disables Cold pixel Detection and Correction.
   // Default value: 0.
   // Data range: 0 to 1 (1u)
   // Constraints: None.
   // Effect: 0 disables the feature, 1 enables the feature.
   //
   // Variable name: highlight_detection_param1.
   // Highlight Detection First Parameter.
   // Default value: 15.
   // Data range: 0 to 15 (4u)
   // Constraint: Sum of three params (highlight_detection_param1/2/3) should be positive value and
   //   default value is 10
   // Effect: A smaller value means that fewer pixels will be reset as "highlight pixel"
   //   after correction. A larger value means that more pixels will be reset as "highlight
   //   pixel" after correction.
   //
   // Variable name: highlight_detection_param2.
   // Highlight Detection Second Parameter.
   // Default value: -6.
   // Data range: -8 to 7 (4s)
   // Constraint: Sum of three params (highlight_detection_param1/2/3) should be positive value and
   //   default value is 10
   // Effect: A smaller value means that fewer pixels will be reset as "highlight pixel"
   //   after correction. A larger value means that more pixels will be reset as "highlight
   //   pixel" after correction.
   //
   // Variable name: highlight_detection_param3.
   // Highlight Detection Third Parameter.
   // Default value: 1
   // Data range: -8 to 7 (4s)
   // Constraint: Sum of three params (Highlight_Detection_Param1/2/3) should be positive value and
   //   default value is 10
   // Effect: A smaller value means that fewer pixels will be reset as "highlight pixel"
   //   after correction. A larger value means that more pixels will be reset as "highlight
   //   pixel" after correction.
   //
   // Core Parameters
   //
   // Variable name: same_channel_detection.
   // Determine if only use central pixel’s Same Channel
   //   Neighbor's information in detection and recovery.
   // Default value: 0 for bright and normal light, 1 for low light.
   // Data range: 0 to 1 (1u)
   // Effect: 0 Use same and cross channel information in BPC detection and Recovery.
   //         1 Only use same cross channel information in BPC detection and Recovery, more
   //           bad pixels (including clusters) will be removed, but more color artifacts will appear.
   //
   // Variable name: same_channel_recovery.
   // Determine if only use central pixel’s Same Channel
   //   Neighbors’ information in recovery.
   // Default value: 0 for bright and normal light, 1 for low light.
   // Data range: 0 to 1 (1u)
   // Effect: 0 Use same and cross channel information in BPC Recovery.
   //         1 Only use same cross channel information in BPC Recovery, but the detection
   //          is still based on same and cross channel information.
   //
   // Variable name: fmax.
   // Ratio of Neighbor from Maximal value in Hot Bad Pixel Detection.
   // Default value: 64.
   // Data range: 64 to 127 (7uQ6)
   // Effect: A smaller value means that more pixels will be detected as Hot Pixel, and
   //   more false detections will be included. A larger value means that fewer pixels will be
   //   detected as Hot pixels, so some real hot pixels may be missed.
   //
   // variable name: fmin.
   // Ratio of Neighbor from Minimal value in Cold Bad Pixel Detection.
   // Default value: 32.
   // Data range: 0 to 64 (7uQ6)
   // Effect: A smaller value means that fewer pixels will be detected as cold pixels
   //   so some real cold pixels may be missed. A larger value means that more pixels will be
   //   detected as cold pixels.
   //
   // variable name: BPC_offset.
   // Offset in Single Bad Pixel Detection.
   // Default value: 256 for bright light, 128 for normal light, 64 for low light.
   // Data range: 0 to 16383 (14u)
   // Effect: A smaller value means that more single pixels will be detected as Single
   //   Bad Pixel, and more false detections will be included. A larger value means that fewer pixels
   //   will be detected as Single Bad pixels, so some real single bad pixels may be missed.
   //   For Non-HDR: Chromatix parameter is for HDR mode. Software will multiply Chromatix value by 4 for Non HDR.
   //
   // Variable name: BCC_offset.
   // Offset in Couplet Bad Cluster Detection.
   // Default value: 256 for bright light, 128 for normal light, 64 for low light.
   // Data range: 0 to 16383 (14u)
   // Effect: A smaller value means that more single pixels will be detected as Couplet
   //   Pixel, and more false detections will be included. A larger value means that fewer pixels
   //   will be detected as Couplet pixels, so some real couplet bad pixels may be missed.
   //   For Non-HDR: Chromatix parameter is for HDR mode. Software will multiply Chromatix value by 4 for Non HDR.
   //
   // Variable name: correction_threshold.
   // Control the difference between correction value
   //   and original value. If the difference is larger than the threshold, the pixel will be corrected.
   // Default value: 256 for bright light, 128 for normal light, 16 for low light.
   // Data range: 0 to 8191 (13u)
   // Effect: A smaller value means that fewer pixels will be reset as "normal pixel" after correction.
   //   A larger value means that more pixels will be reset as "normal pixel" after correction.
   //   For Non-HDR: Chromatix parameter is for HDR mode. Software will multiply Chromatix value by 4 for Non HDR.
   //
   // Variable name: noise_model_gain.
   // Local noise contribution on BPC/BCC detection.
   // Default value: 0.
   // Data range: 0 to 255 (8uQ6)
   // Effect: A smaller value means that more BPC/BCC pixels will be detected and more
   //   false detections will be included. A larger value means that fewer BPC/BCC pixels will be
   //   detected, so some real bad pixels may be missed.
   //
   // Variable name: highlight_detection_threshold.
   // Highlight threshold between the central pixel and
   //   its neighbors. If the difference is below the threshold, it will be detected as
   //   "normal highlight" pixel.
   // Default value: 160 for bright light, 96 for normal light, 16 for low light.
   // Data range: 0 to 1048575 (20u)
   // Effect: A smaller value means that fewer pixels will be reset as "highlight pixel"
   //   after correction. A larger value means that more pixels will be reset as "highlight
   //   pixel" after correction.
   //   For Non-HDR: Chromatix parameter is for HDR mode. Software will multiply Chromatix value by 4 for Non HDR.
   //
