   //     snapshot processing, and video modes.
   //
   // Note:
   // Using this parameter set and Bayer histogram (green channel) to generate a global tone mapping curve for HD mode.
   //
   // Variable name: gtm_enable
   // Description: Enables the feature.
   // Data range: 0 or 1.
   //
   // Variable name: tuning_control_type control_gtm
   // Description: Gain , Luxindex or Exposure Ratio to control GTM parameters
   // Data range: 0 , 1 or CONTROL_AEC_EXP_SENSITIVITY_RATIO(2)
   //
   // Variable name: trigger_point2_type aec_sensitivity_ratio
   // Description: start and end value for each of the region.Region between Start and End forms interpolation Region, trigger less than
   //   start is non interpolation region.
   //
   // Variable name: GTM_maxval_th.
   // Description: Lower bound of input Max value, to avoid non-linear mapping small/low dynamic range scenes to full output range.
   // Default value: 1024.
   // Data range: 0 to 16383.
   // Effect: DO NOT CHANGE.
   //
   // Variable name: GTM_key_min_th.
   // Description: Key low threshold, constrain the Key to not fall below this to avoid making dark scenes too bright.
   // Default value: 64.
   // Data range: 0 to 16383
   // Effect: DO NOT CHANGE.
   //
   // Variable name: GTM_key_max_th.
   // Description: Key high threshold, constrain the Key to not go above this to avoid making bright scenes too dark.
   // Default value: 4096.
   // Data range: 0 to 16383.
   // Effect: DO NOT CHANGE.
   //
