         //
         // Q_skin and Q_nonskin are HW parameters (not exposed in Chromatix header). These are quantization step factor, for the linear transition in skin-tone
         // and non-skin regions. Valid Range of these parameters are [0 128] (8uQ8). They are calculated from Chromatix header parameters as:
         // Q_skin =(100.0 - skin_percent) / (200.0 * (16 - boundary_probability)),
