   // Variable name: control_hdr
   // Use Exposure Ratio or Exp time ratio to control HDR
   // Data range: CONTROL_AEC_EXP_SENSITIVITY_RATIO(2) or CONTROL_EXP_TIME_RATIO(3).
   // Default value: CONTROL_AEC_EXP_SENSITIVITY_RATIO(2)
   //
   // Variable name: aec_sensitivity_ratio/exp_time_trigger
   // aec sensitivity ratio/exp time trigger start and end value for each region.
   // Region between Start and End forms interpolation Region, trigger less than
   //   start is non interpolation region.
   //
   // Variable name: module_cfg_hdr_recon_en // 1u.
   // Description: This flag when set to 1 enables HDR RECON module. Default is Disable (0).
   // Constraints: This Flag Should be enabled only for VIDEO MODE and HDR Sensors.
   // Default value: 0 (Disable).
   //
   // Variable name: module_cfg_hdr_mac_en // 1u.
   // Description: This flag when set to 1 enables HDR MAC module. Default is Disable (0).
   // Constraints: This Flag Should be enabled only for VIDEO MODE and HDR Sensors.
   // Default value: 0 (Disable).
   //
   // Variable name: recon_linear_mode // 1u.
   // This bit enables RECON HDR linear mode (1) or normal mode (0).
   //   When in linear mode and exp_ratio = 1.0, RECON processing is bypassed.
   // Default value: 0.
   // Range: 0 to 1.
   // Effect: Enables RECON HDR linear mode.
   //
   // Variable name: mac_linear_mode // 1u.
   // This bit enables MAC HDR linear mode (1) or normal mode (0).
   // When in linear mode and exp_ratio = 1.0, MAC processing is bypassed except for applying WB gain,
   //   clipping to 10-bit, removing WB gain.
   // Default value: 0.
   // Range: 0 to 1.
   // Effect: Enables MAC HDR linear mode.
   //
   // Variable name: recon_first_field // 1u.
   // Not used.
   //
   // Variable name: recon_edge_lpf_tap0 // 3uQ4,
   // Tap0 value for low-pass filter applied before edge detection.
   // Default value: 3.
   // Range: 0 to 5.
   //
   // Variable name: recon_flat_region_th // 10u.
   // This value represents the threshold for the flat region in edge detection.
   // Default value: 64.
   // Range: 0 to 1023.
   // Effect: If d_max<th, consider current 2x2 pixel as flat region and force vertical edge direction.
   //
   // Variable name: recon_min_factor // 5uQ4.
   // This value represents min to mid factor to force vertical edge direction.
   // Default value: 12.
   // Range: 0 to 31 allowed, but 0 to 16 meaningful.
   // Effect: Scaling factor to force vertical direction: if 16*d_min>min_factor*d_sec_min (min and mid
   //   not sufficiently apart), force vertical edge direction.
   //
   // Variable name: recon_h_edge_th1 // 10u.
   // This value represents threshold 1 for the horizontal edge switching function.
   // Default value: 16.
   // Range: 0 to 1023
   // Effect: Controls the threshold of vertical difference to be recognized as horizontal edge.
   //
   // Variable name: recon_h_edge_dth_log2 // 4u.
   // log2(th2-th1) for horizontal edge switching function.
   // Default value: 4.
   // Range: 4 to 8.
   // Effect: Controls the slope of the soft switching.
   //
   // Variable name: recon_motion_th1  // 10u.
   // This value represents threshold 1 for the motion switching function.
   // Default value: 184.
   // Range: 0 to 1023.
   // Effect: Controls the threshold of T1 vs T2 difference to be recognized having motion.
   //
   // Variable name: recon_motion_dth_log2 // 4u.
   // Brief description: log2(th2-th1) for motion switching function.
   // Default value: 4.
   // Range: 4 to 8.
   // Effect: Controls the slope of the motion switching.
   //
   // Variable name: recon_dark_th1 // 10u.
   // This value represents threshold 1 for the dark noise switching function.
   // Default value: 0.
   // Range: 0 to 1023.
   // Effect: Controls the detail/noise level trade-off of dark region.
   //
   // Variable name: recon_dark_dth_log2 // 3u.
   // log2(th2-th1) for dark noise switching function.
   // Default value: 4.
   // Range: 0-4.
   // Effect: Controls the slope of the dark switching.
   //
   // Variable name: mac_motion0_th1 // 10u.
   // This value represents the noise floor value for motion detection.
   //   Noise model is: noise = th2*sqrt(gain*intensity)+th1.
   // Default value: 60.
   // Range: 0 to 1023.
   // Effect: Controls the noise floor for motion switching.
   //
   // variable name: mac_motion0_th2 // 8u.
   // This value represents the noise-luma slope for motion detection.
   // Default value: 24.
   // Range: 0 to 255.
   //
   // Variable name: mac_motion0_dt0 // 6u.
   // An additive term to noise estimate, to avoid dividing by zero.
   // Default value: 1.
   // Range: 1 to 63.
   // Effect: To avoid dividing by zero.
   //
   // Variable name: mac_motion_strength // 5uQ4.
   // This value represents the motion adaptation strength value.
   // Default value: 8.
   // Range: 0 to 16.
   // Effect: Controls how strongly motion would affect T1/T2 combination.
   //
   // Variable name: mac_low_light_th1 // 14u.
   // This value represents the threshold  1 value for low light switching.
   // Default value: 0.
   // Range: 0 to 16383.
   // Effect: Controls the low light switching.
   //
   // Variable name: mac_low_light_dth_log2 // 4u.
   // log2(th2-th1) for low light switching.
   // Default value: 6.
   // Range: 2 to 14.
   // Effect: Controls the slope of low light switching.
   //
   // Variable name: mac_low_light_strength // 5uQ4.
   // This value represents the log light switching strength value.
   // Default value: 8.
   // Range: 0 to 16.
   // Effect: Controls how strongly lowlight would affect T1/T2 combination.
   //
   // Variable name: mac_high_light_th1 // 14u.
   // This value represents the threshold  1 value for high light switching.
   // Default value: 232.
   // Range: 0 to 16383.
   // Effect: Controls the high light switching.
   //
   // Variable name: mac_high_light_dth_log2 // 4u.
   // This value represents the  log2(th2 – th1) value for high light switching for the right plane in 3D mode
   // Default value: 10.
   // Range: 2 to 14.
   // Effect: log2(th2-th1) for high light switching.
   //
   // Variable name: mac_smooth_enable // 1u.
   // Enable motion adaptive smoothing, an optional step in MAC.
   // Default value: 1.
   // Range: 0 to 1.
   // Effect: Enables motion adaptive smoothing.
   //
   // Variable name: mac_smooth_th1 // 9uQ8.
   // Th1 for motion adaptive smoothing.
   // Default value: 192.
   // Range: 0 to 256.
   // Effect: Th1 for motion adaptive smoothing.
   //
   // Variable name: mac_smooth_dth_log2 // 4u.
   // log2(th2-th1) for motion adaptive smoothing.
   // Default value: 6.
   // Range: 2 to 8.
   // Effect: Controls the slope of motion adaptive smoothing.
   //
   // Variable name: mac_motion_dilation // 3u.
