   /******************************************************************************/
   // Feature name: Chroma Aberration Correction
   // Applicable chipset(s): HW version 8084 or later, SW version can be applied to any chipsets.
   // Applicable operation mode:
   // All Default Values are defined on 12 Bits' Data
   //
   // Variable name: NZ_HV[8].
   // Control Sign of Horizontal / Vertical Coefficients
   //   (corresponds to NZ[8] used in Horizontal/Vertical Edge Detection in HW Design).
   // Default value:  NZ_HV[0] = NZ_HV[1] = NZ_HV[2] = 1 / NZ_HV[4] = NZ_HV[5] = NZ_HV[6] = -1 / NZ_HV[3] = NZ_HV[7] = 0
   // Data range: -1 to 1.
   // Constraints: Each Item Value are selected from [-1 0 1].
   // Effect:
   //
   // Variable name: NZ_D[8].
   // Control Sign of Diagonal Coefficients
   //   (corresponds to NZ[8] used in Diagonal Edge Detection  in HW Design).
   // Default value:  NZ_D[0] = NZ_D[1] = NZ_D[2] = 1 / NZ_D[4] = NZ_D[5] = NZ_D[6] = -1 / NZ_D[3] = NZ_D[7] = 0
   // Data range: -1 to 1.
   // Constraints: Each Item Value are selected from [-1 0 1]
   // Effect:
   //
   // Variable name: Fx[9].
   // Edge Detection Filter Coefficient
   //   (corresponds to Fx in HW Design).
   // Default value:  Sobel Filter Fx[0] = Fx[1] = Fx[2] = Fx[3] = Fx[6] = Fx[7] = Fx[8] = 0 / Fx[4] = 1 Fx[5] = 2
   // Data range: Fx[0]/Fx[1]/Fx[3]/Fx[4]: -15 to 15;  Fx[2]/Fx[5]/Fx[6]/Fx[7]: -31 to 31;  Fx[8]: -63 to 63.
   // Constraints:
   // Effect:
   //
   // Variable name: ThSaturation.
   // Threshold value to control if a pixel is beside a Saturation Region
   //   (corresponds to ThSaturation in HW design).
   // Default value:  2000.
   // Data range: 0 to 4095.
   // Constraints:
   // Effect: If the values is smaller, more pixels will be detected beside saturation region,
   //         meaning that more pixels may be set as CAC pixel and be processed.
   //
   // Variable name: ThEdge.
   // Threshold value to control if a pixel is an edge pixel
   //   (corresponds to ThEdge in HW design).
   // Default value: 320.
   // Data range: 0 to (2^17-1) if enabled. Negative value to disable.
   // Constraints:
   // Effect: For positive values, if the value is smaller more pixels will be detected as edge,
   //         meaning that more pixels may be set as CAC pixel and be processed.
   //         Set a negative value to diable the feature in software.
   //
   // Variable name: PossibleCAPixelRGHighThreshold (HW 19uQ7)
   // Threshold value to control the maximal possible Chroma1 value that a chromatic aberration pixel may have.
   //   The pixels with Chroma1 value larger than the Threshold cannot be 'chromatic aberration pixel'
   //   (corresponds to UpThrRG in HW design).
   // Default value:  2.0
   // Data range: 0 to 31.99
   // Constraints:
   // Effect: If the value is smaller, more pixels will be detected
   //         as impossible chromatic aberration, meaning that fewer
   //         pixels may be set as CAC pixel and be processed.
   //
   // Variable name: PossibleCAPixelRGLowThreshold (HW 19uQ7)
   // Threshold value to control the minimal possible Chroma1 value that a chromatic aberration pixel may have.
   //   The pixels with Chroma1 value less than the Threshold cannot be 'chromatic aberration pixel'
   //   (corresponds to LowThrRG in HW design).
   // Default value:  0.25
   // Data range: 0 to 31.99
   // Constraints:
   // Effect: If the values is larger, more pixels will be detected
   //         as impossible chromatic aberration, meaning that fewer
   //         pixels may be set as CAC pixel and be processed.
   //
   // Variable name: PossibleCAPixelBGHighThreshold (HW 19uQ7)
   // Threshold value to control the maximal possible Chroma2 value that a chromatic aberration pixel may have.
   //   The pixels with Chroma2 value larger than the Threshold cannot be 'chromatic aberration pixel'
   //   (corresponds to UpThrBG in HW design).
   // Default value:  2.0
   // Data range: 0 to 31.99
   // Constraints:
   // Effect: If the values is smaller, more pixels will be detected
   //         as impossible chromatic aberration, meaning that fewer
   //         pixels may be set as CAC pixel and be processed.
   //
   // Variable name: PossibleCAPixelBGLowThreshold (HW 19uQ7)
   // Threshold value to control the minimal possible Chroma2 value that a chromatic aberration pixel may have.
   //   The pixels with Chroma2 lower than Threshold cannot be 'chromatic aberration pixel'
   //   (corresponds to LowThrBG in HW design).
   // Default value:  0.25
   // Data range: 0 to 31.99
   // Constraints:
   // Effect: If the value is larger, more pixels will be detected
   //         as impossible chromatic aberration, meaning that fewer
   //         pixels may be set as CAC pixel and be processed.
   //
   // Variable name: RGDifferenceHighThreshold (HW 19uQ7)
   // Threshold value to control the maximal possible Chroma1 difference between predicted chromatic aberration hue and real hue.
   //   The pixels with Chroma1 difference larger than this threshold will be viewed as 'Normal Pixel'
   //   (corresponds to ThHighRG in HW design).
   // Default value:  1.20
   // Data range: 0 to 7.99
   // Constraints:
   // Effect: If the value is smaller, more pixels will be detected
   //         as impossible chromatic aberration, meaning that fewer
   //         pixels may be set as CAC pixel and be processed.
   //
   // Variable name: RGDifferenceLowThreshold (HW 19uQ7)
   // Threshold value to control the minimal possible Chroma1 difference between predicted chromatic aberration hue and real hue.
   //   The pixels with Chroma1 difference smaller than this threshold will be viewed as 'Chromatic Aberration Pixel'
   //   and should be 'recovered' using neighbor pixel's hue
   //  (corresponds to ThLowRG in HW design).
   // Default value:  0.20
   // Data range: 0 to 7.99
   // Constraints:
   // Effect: If the value is larger, more pixels will be detected
   //         as chromatic aberration, meaning that more pixels
   //         may be set as CAC pixel and be processed.
   //
   // Variable name: BGDifferenceHighThreshold (HW 19uQ7)
   // Threshold value to control the maximal possible Chroma2 difference between predicted chromatic aberration hue and real hue.
   //   The pixels with Chroma2 difference larger than this threshold will be viewed as 'Normal Pixel'
   //   (corresponds to ThHighBG in HW design).
   // Default value:  1.20
   // Data range: 0 to 7.99
   // Constraints:
   // Effect: If the value is smaller, more pixels will be detected
   //         as impossible chromatic aberration, meaning that fewer
   //         pixels may be set as CAC pixel and be processed.
   //
